import React, { useState, useEffect } from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Axios from "axios";

// Import Modal Components
import ModalButton from "./components/modal/ModalButton";
import ModalOverlay from "./components/modal/ModalOverlay";

const GET_ADDRESS = "http://localhost:5000/orders/all";

function App() {
  // States
  const [modalOpen, setModalOpen] = useState(false);
  const [filter, setFilter] = useState("all");
  const [displayOrders, setDisplayOrders] = useState([]);

  // Functions
  const displayMe = () => {
    Axios.get(GET_ADDRESS)
      .then(function (response) {
        console.log("Order created!");
        console.log(response.data);
      })
      .catch(function (error) {
        if (error.response) {
          // Request made and server responded
          console.log("Response Error");
          console.log(error.response.data.error.message);
        } else if (error.request) {
          // The request was made but no response was received
          console.log("No Response Error!");
          console.log(error.request);
        } else {
          console.log("Request Creation Error!");
          console.log("Error", error.message);
        }
      });

    console.log("Hi");
  };

  return (
    <div className="App">
      <button onClick={displayMe}>CLICK ME!!!</button>
      <ModalButton setModalOpen={setModalOpen} />
      <ModalOverlay setModalOpen={setModalOpen} modalOpen={modalOpen} />
    </div>
  );
}

export default App;
